import React from 'react';
import api from '../services/OpenAI';

class PetNamesComponent extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            petNames: [],
            specie: props.specie,
            api: api,
        }
    }

    componentDidMount(){
        this.state.api.post("nlp-pet-name/specie/"+this.state.specie).then(
            res =>{
                console.log(res.data);
                const specie = res.data.specie;
                this.setState({ specie });

                const petNames = res.data.names;
                this.setState({ petNames });
            })
    }

    render(){
        return(
            <div className="result-pet-names">
            <ul>
            {this.state.petNames}
            </ul>
        </div>
        )
    }
}

export default PetNamesComponent;
